import React, { Fragment } from "react";
import { Form, Input, Layout, Typography, Row, Col, Button } from "antd";
import MenuFooter from "../custom/footer";

const RememberPassword = () => {
  return (
    <Fragment>
      <Layout>
        <Layout.Content style={{ margin: "5em 16px" }}>
          <div
            style={{
              background: "#fff",
              padding: 44,
              minHeight: 380
            }}
            className="border border-danger"
          >
            <Form hideRequiredMark>
              <Row justify="center">
                <Col>
                  <Typography.Title>Remember Password</Typography.Title>
                </Col>
              </Row>
              <Row justify="center">
                <Col span={10}>
                  <Form.Item
                    name="email"
                    label="Email"
                    rules={[
                      { required: true, type: "email", message: "Enter email" }
                    ]}
                  >
                    <Input width="w-100" />
                  </Form.Item>
                </Col>
                <Col>
                  <Form.Item>
                    <Button>Send</Button>
                  </Form.Item>
                </Col>
              </Row>
            </Form>
          </div>
        </Layout.Content>
      </Layout>
      <MenuFooter />
    </Fragment>
  );
};

export default RememberPassword;
